    trait Parts {
        type T;
        fn lo(&self) -> Self::T;
        fn hi(&self) -> Self::T;
    }


    impl Parts for u16 {
        type T = u8;
        fn lo(&self) -> u8
        {
            (self & 0xFF) as u8
        }

        fn hi(&self) -> u8
        {
            ((self >> 8) & 0xFFu16) as u8
        }
    }


    pub fn init()
    {
        // Set GPIO functions for ILI9340.
        gpio::set_pin_function(gpio::Pin::Spi0Ce0N, gpio::Function::Alternate0);
        gpio::set_pin_function(gpio::Pin::Spi0Mosi, gpio::Function::Alternate0);
        gpio::set_pin_function(gpio::Pin::Spi0Sclk, gpio::Function::Alternate0);
        gpio::set_pin_function(gpio::Pin::Ili9340Dc, gpio::Function::Output);
        Addr::Spi0RegisterCs.store::<u32>(0x30);
        Addr::Spi0RegisterClk.store::<u32>(4);

        // Software Reset
        write_command(0x01);
        timer::wait(120);

        // Display OFF
        write_command(0x28);

        // Power Control 1
        write_command(0xC0);
        write_data(0x23);
        write_data(0x00);

        // Power Control 2
        write_command(0xC1);
        write_data(0x10);

        // VCOM Control 1
        write_command(0xC5);
        write_data(0x3E);
        write_data(0x28);

        // VCOM Control 2
        write_command(0xC7);
        write_data(0x86);

        // COLMOD: Pixel Format Set
        write_command(0x3A);
        write_data(0x55);

        // Frame Rate Control (In Normal Mode/Full Colors)
        write_command(0xB1);
        write_data(0x00);
        write_data(0x18);

        // Display Function Control
        write_command(0xB6);
        write_data(0x08);
        write_data(0x82);
        write_data(0x27);

        // Gamma Set
        write_command(0x26);
        write_data(0x01);

        // Positive Gamma Correction
        write_command(0xE0);
        write_data(0x0F);
        write_data(0x31);
        write_data(0x2B);
        write_data(0x0C);
        write_data(0x0E);
        write_data(0x08);
        write_data(0x4E);
        write_data(0xF1);
        write_data(0x37);
        write_data(0x07);
        write_data(0x10);
        write_data(0x03);
        write_data(0x0E);
        write_data(0x09);
        write_data(0x00);

        // Negative Gamma Correction
        write_command(0xE1);
        write_data(0x00);
        write_data(0x0E);
        write_data(0x14);
        write_data(0x03);
        write_data(0x11);
        write_data(0x07);
        write_data(0x31);
        write_data(0xC1);
        write_data(0x48);
        write_data(0x08);
        write_data(0x0F);
        write_data(0x0C);
        write_data(0x31);
        write_data(0x36);
        write_data(0x0F);

        // Memory Access Control
        write_command(0x36);
        write_data(0x28);

        // Sleep Out
        write_command(0x11);
        timer::wait(120);

        // Display ON
        write_command(0x29);

        fill_screen(0x0000);
    }


    pub fn fill_screen(color: u16)
    {
        set_draw_area(0, 320, 0, 240);
        for _ in 0..(320 * 240) {
            set_color(color);
        }
    }


    pub fn draw_aa()
    {
        let aart = "    ___                   __\n   /   |   _  __  ___    / /\n  / /| |  | |/_/ / _ \\  / /\n / ___ | _>  <  /  __/ / /\n/_/  |_|/_/|_|  \\___/ /_/";
        draw_string(50, 100, aart, 0x0000, 0b1111100000000000);
    }


    pub fn draw_girl()
    {
        set_draw_area(0, GIRL_WIDTH, 0, GIRL_HEIGHT);
        for i in 0..(GIRL_HEIGHT as usize * GIRL_WIDTH as usize) {
            set_color(GIRL_COLORS[i]);
        }
    }


    fn set_draw_area(x_begin: u16, x_end: u16, y_begin: u16, y_end: u16)
    {
        write_command(0x00);

        // Column Address Set
        write_command(0x2A);
        write_data(x_begin.hi());
        write_data(x_begin.lo());
        let tmp = x_end - 1;
        write_data(tmp.hi());
        write_data(tmp.lo());

        // Page Address Set
        write_command(0x2B);
        write_data(y_begin.hi());
        write_data(y_begin.lo());
        let tmp = y_end - 1;
        write_data(tmp.hi());
        write_data(tmp.lo());

        // Memory Write
        write_command(0x2C);
    }


    fn set_color(color: u16)
    {
        write_data(color.hi());
        write_data(color.lo());
    }


    fn draw_string(x_begin: u16, y_begin: u16, string: &str, color_bg: u16, color_fg: u16) {
        let mut x = x_begin;
        let mut y = y_begin;

        for c in string.chars() {
            if c == '\n' {
                x = x_begin;
                y += FONT_HEIGHT;
                continue;
            }

            draw_char(x, y, c, color_bg, color_fg);
            x += FONT_WIDTH;
        }
    }


    fn draw_char(x_begin: u16, y_begin: u16, c: char, color_bg: u16, color_fg: u16)
    {
        write_command(0x00);
        set_draw_area(x_begin, x_begin + FONT_WIDTH, y_begin, y_begin + FONT_HEIGHT);

        let char_code = c as u8;
        let font = FONTS[char_code as usize];

        for i in 0..FONT_HEIGHT {
            let line = font[i as usize];
            for j in 0..FONT_WIDTH {
                let bit = (line >> (FONT_WIDTH - j - 1)) & 0x1;
                if bit == 1 {
                    set_color(color_fg);
                } else {
                    set_color(color_bg);
                }
            }
        }
    }


    fn draw_dot(x: u16, y: u16, c: u16)
    {
        set_draw_area(x, x + 1, y, y + 1);
        set_color(c);
    }


    fn write_command(command: u8)
    {
        // Set register for writing command.
        gpio::write_output_pin(gpio::Pin::Ili9340Dc, gpio::Output::Clear);
        super::spi_transfer(command);
    }


    fn write_data(data: u8)
    {
        // Set register for writing data.
        gpio::write_output_pin(gpio::Pin::Ili9340Dc, gpio::Output::Set);
        super::spi_transfer(data);
    }
